import React from 'react';

function Tile(props) {

  function poner_foto(symbol){
    if (symbol === "cacao seco"){
      return require("../imgs/cacao.png");
    }
    if (symbol === "cacao"){
      return require("../imgs/cacao.png");
    }

    if (symbol === "cacao tostado"){
      return require("../imgs/cacao.png");
    }

  }
    return (
      <section className="Tile">
        {/* <p id="p_tile">{props.symbol}</p>
         */}
        <img src={poner_foto(props.symbol)} alt={props.symbol} className='img_tile'></img>

      </section>
    );
  }

  export default Tile;
